import { images } from "../../config/images";

export const NGOProps = {
  popularSecProps: {
    CardListData: [
      {
        src: images.Wwf,
      },
      {
        src: images.American,
      },
      {
        src: images.Habitat,
      },
      {
        src: images.Charity,
      },
      {
        src: images.Guidestart,
      },
    ],
  },
};
